import React from "react";

function AllSites() {
  return (
    <Router>
        <div>THIS IS THE SITES PAGE</div>
        <nav>
            <Link to="/"> Home </Link>
            <Link to="/sites"> Sites </Link>
            <Link to="/site/:name"> Site </Link>
        </nav>
    </Router>
  );
}

export default AllSites;
